import React from 'react';

const Project1 = () => {
  return (
    <div className="container mx-auto p-4">
      <h1 className="text-4xl font-bold">Project 1</h1>
      <p className="mt-4">

        This is the description for Diabetes project. Here you can include details about the project, such as objectives, technologies used, and outcomes.

       </p>
    </div>
  );
};

export default Project1;
